webpackJsonp([70704909314087],{8263:function(t,e){t.exports={data:{post:{html:"<p>You'd think in the current German coalition talks that the SPD could at least <strong>play</strong> hard to get.</p>\n<p>Now I know German politics is a strange beast, but I would think that the SPD side more has more pull here. The Union is the side that needs desperately to form a coalition with Merkel in charge. The SPD never wanted a new grand coalition (so they claim), you'd think they could take or leave it, and demand a high price to take it. </p>\n<p>Then again, what do I know? </p>",fields:{title:"Hard to Get",date:"17 Jan 2018",url:"https://papascott.de/2018-01-17-hard-to-get/"}}},pathContext:{slug:"/2018-01-17-hard-to-get/",prev:{fields:{title:"Winter Workshop",date:"12 Jan 2018",slug:"/2018-01-12-winter-workshop/"}},next:{fields:{title:"Block E",date:"19 Jan 2018",slug:"/2018-01-19-block-e/"}}}}}});
